import styled from "styled-components";
import { COLORS } from "../../constants";

const Wrapper = styled.div`
    background-color: ${COLORS.neutral.blueCard};
    padding: 32px;
    border-radius: 16px;
`;

const ImageWrapper = styled.div`
    border-radius: 16px;
    overflow: hidden;
`;


function Card() {
    return (
        <Wrapper>
            <ImageWrapper>
                <img src="images/equilibrium.jpg" alt="equilibrium" />
            </ImageWrapper>
        </Wrapper>
    )
};

export default Card;
